import React from "react";

const Footer = () => {
  return (
    <div class="footer" id="footer">
      <div className="footer-left" id="footer-left">
        <p className="title"> SUPPORT & INFORMATION </p>{" "}
        <ul className="footer-list">
          <li> Customer service </li> <li> About us </li>{" "}
          <li> Terms & Privacy Policy </li> <li> Personal data </li>{" "}
          <li> Cookies </li> <li> GEEK.SE 2023 - Borl√§nge </li>{" "}
        </ul>{" "}
      </div>{" "}
      <div className="footer-mid">
        <p className="title"> PAYMENT SOLUTIONS WE SUPPORT </p>{" "}
        <ul className="footer-list">
          <li> Klarna </li> <li> Paypal </li> <li> Visa </li>{" "}
        </ul>{" "}
      </div>{" "}
      <div className="footer-right">
        <p className="title"> CONTACT US </p>{" "}
        <img
          class="footer_icon"
          src={require("../images/facebook.png")}
          alt="shape"
          height={30}
          width={30}
        />{" "}
        <img
          class="footer_icon"
          src={require("../images/twitter.png")}
          alt="shape"
          height={30}
          width={30}
        />{" "}
        <img
          class="footer_icon"
          src={require("../images/email.png")}
          alt="shape"
          height={30}
          width={30}
        />{" "}
        <img
          class="footer_icon"
          src={require("../images/youtube.png")}
          alt="shape"
          height={30}
          width={30}
        />{" "}
      </div>{" "}
    </div>
  );
};

export default Footer;
